import React, { useState } from "react";

function App() {
  const [demandId, setDemandId] = useState("");
  const [duration, setDuration] = useState(24);
  const [logs, setLogs] = useState([]);
  const [count, setCount] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [wfmsLogs, setWfmsLogs] = useState([]);
  const [pricingLogs, setPricingLogs] = useState([]);
  const [consignerLogs, setConsignerLogs] = useState([]);
  const [summary, setSummary] = useState(null);
  const [summaryLoading, setSummaryLoading] = useState(false);
  const [showSummary, setShowSummary] = useState(false);

  const fetchLogs = async () => {
    setLoading(true);
    setError(null);
    setWfmsLogs([]);
    setPricingLogs([]);
    setConsignerLogs([]);
    setLogs([]);
    setCount(null);
    try {
      const res = await fetch(`/api/logs?demandId=${demandId}&duration=${duration}`);
      const data = await res.json();
      setWfmsLogs(data.wfmsLogs || []);
      setPricingLogs(data.pricingLogs || []);
      setConsignerLogs(data.consignerLogs || []);
      setCount(data.count);
    } catch (err) {
      setError(err.message);
    }
    setLoading(false);
  };

  const fetchSummary = async () => {
    setSummaryLoading(true);
    setError(null);
    setSummary(null);
    try {
      const res = await fetch(`/api/logs/summary?demandId=${demandId}&duration=${duration}`);
      const data = await res.json();
      setSummary(data);
      setShowSummary(true);
    } catch (err) {
      setError(err.message);
    }
    setSummaryLoading(false);
  };

  return (
    <div style={{ padding: 32, fontFamily: 'sans-serif' }}>
      <h2>WFMS Log Search</h2>
      <input
        placeholder="Demand ID"
        value={demandId}
        onChange={e => setDemandId(e.target.value)}
        style={{ marginRight: 8 }}
      />
      <input
        type="number"
        placeholder="Duration (hours)"
        value={duration}
        onChange={e => setDuration(e.target.value)}
        style={{ marginRight: 8, width: 120 }}
        min={1}
      />
      <button onClick={fetchLogs} disabled={loading || !demandId}>
        {loading ? "Loading..." : "Fetch Logs"}
      </button>
      <button onClick={fetchSummary} disabled={summaryLoading || !demandId} style={{ marginLeft: 8 }}>
        {summaryLoading ? "Loading..." : "View Pod-wise Summary"}
      </button>
      <div style={{ marginTop: 24 }}>
        {error && <div style={{ color: 'red' }}>Error: {error}</div>}
        {count !== null && <div>Log Count: {count}</div>}
        <h3>WFMS Logs</h3>
        <pre style={{ maxHeight: 200, overflow: "auto", background: "#f5f5f5", padding: 12 }}>
          {wfmsLogs.map((log, i) => <div key={i}>{JSON.stringify(log, null, 2)}</div>)}
        </pre>
        <h3>Pricing Logs</h3>
        <pre style={{ maxHeight: 200, overflow: "auto", background: "#f5f5f5", padding: 12 }}>
          {pricingLogs.map((log, i) => <div key={i}>{JSON.stringify(log, null, 2)}</div>)}
        </pre>
        <h3>Consigner Aggregator Logs</h3>
        <pre style={{ maxHeight: 200, overflow: "auto", background: "#f5f5f5", padding: 12 }}>
          {consignerLogs.map((log, i) => <div key={i}>{JSON.stringify(log, null, 2)}</div>)}
        </pre>
      </div>
      {showSummary && summary && (
        <div style={{ marginTop: 32, background: '#eef', padding: 16, borderRadius: 8 }}>
          <h3>Pod-wise Log Summary</h3>
          {Object.entries(summary).map(([service, pods]) => (
            <div key={service} style={{ marginBottom: 24 }}>
              <h4>{service.replace('Logs', '')}:</h4>
              {pods.length === 0 && <div>No logs found.</div>}
              {pods.map((pod, i) => (
                <div key={i} style={{ marginBottom: 12, padding: 8, background: '#fff', borderRadius: 4, border: '1px solid #ccd' }}>
                  <b>Pod:</b> {pod.pod} <b>Count:</b> {pod.count}<br/>
                  {pod.demandCreated && <div><b>Demand Created:</b> <pre style={{ display: 'inline', background: 'none', padding: 0 }}>{pod.demandCreated}</pre></div>}
                  {pod.quotes && pod.quotes.length > 0 && (
                    <div><b>Quotes:</b> <ul>{pod.quotes.map((q, idx) => <li key={idx}><pre style={{ display: 'inline', background: 'none', padding: 0 }}>{q}</pre></li>)}</ul></div>
                  )}
                  {pod.statusUpdates && pod.statusUpdates.length > 0 && (
                    <div><b>Status Updates:</b> <ul>{pod.statusUpdates.map((s, idx) => <li key={idx}><pre style={{ display: 'inline', background: 'none', padding: 0 }}>{s}</pre></li>)}</ul></div>
                  )}
                </div>
              ))}
            </div>
          ))}
          <button onClick={() => setShowSummary(false)} style={{ marginTop: 8 }}>Hide Summary</button>
        </div>
      )}
    </div>
  );
}

export default App;
